import { 
    AUTH_LOGGED_IN,
    AUTH_LOGGED_OUT,
    AUTH_LOGGED_IN_ERROR
} from '../Actions/actionType'


const initialStateOfAuth={
    token: null,
    userData: null
}

export function userAuthReducer(state=initialStateOfAuth,action){
    switch(action.type){
        case AUTH_LOGGED_IN:
            return action.payload;
        case AUTH_LOGGED_OUT:
            return action.payload;
        case AUTH_LOGGED_IN_ERROR:
            return action.payload;
        default:
            return state
    }
}
